var tipuesearch = {"pages":[{"title":"About","url":"./pages/about/","text":"2016Fall 修課成員網誌","tags":"misc"},{"title":"2016Fall Week1","url":"./2016fall-week1.html","text":"cdt Week1 第一週 登入既有的Github倉儲,並Fork(https://github.com/mdecourse/2016fallcadp) 建立 2016fallcadp_hw 倉儲, 將分支設為 gh-pages 再建立一個名稱為(帳號).github.io的倉儲, 並在裡面建立 index.html 就可以用 https://帳號.github.io 連結到 index.html 自選組員, 確定各組組長學號, 組長再設為[課程倉儲] (https://github.com/mdecourse/2016fallcadp) 的協同者, 負責協助管理這個倉儲, 並管理組員對倉儲的 pull requests","tags":"Misc"},{"title":"2016Fall Week10","url":"./2016fall-week10.html","text":"fgh","tags":"Misc"},{"title":"2016Fall Week11","url":"./2016fall-week11.html","text":"zxc","tags":"Misc"},{"title":"2016Fall Week12","url":"./2016fall-week12.html","text":"uio","tags":"Misc"},{"title":"2016Fall Week13","url":"./2016fall-week13.html","text":"","tags":"Misc"},{"title":"2016Fall Week2","url":"./2016fall-week2.html","text":"gh-pages Week2 第二週 如何使用ShareX來錄製影片還有截圖 先去ShareX官方網站下載軟體 選軟體的Task settings裡的Screen recorder,再選Screen recording設定錄影畫面及錄音型式 到軟體的Application settings中的path來設定存檔內容 按Shift+Print Scrn可以選擇錄影範圍 再按下Shift+Print Scrn可以停止錄影","tags":"Misc"},{"title":"2016Fall Week3","url":"./2016fall-week3.html","text":"NG Week3 第三週 1.如何讓自己的個人課程倉儲能顯示基本架構: 先從Github拉下自己的倉儲 去班級倉儲把班級倉儲也拉下來 把課程倉儲的基礎架構複製並覆蓋掉個人倉儲,但要住意有幾個檔案不能蓋到,可能會讓倉儲毀損 把覆蓋好的倉儲推上遠端取代原有的倉儲 2.如何讓自己的index有基本架構: 到scrum-3的倉儲裡的index複製程式碼 將程式碼複製到個人網頁的index","tags":"Misc"},{"title":"2016Fall Week4","url":"./2016fall-week4.html","text":"111 Week4 第四週 建立分組倉儲並把組員加入子模組來共同編輯 由組長建立分組倉儲，倉儲名稱為2016fallcp_ag(組別) 複製更新過的倉儲基本架構到自己組別的倉儲中 再來組長將組員納為子模組成員 子模組指令: git submodule add -b gh-pages https://github.com/scrum-1/2016fallcp_ag100 g100","tags":"Misc"},{"title":"2016Fall Week5","url":"./2016fall-week5.html","text":"ddf","tags":"Misc"},{"title":"2016Fall Week6","url":"./2016fall-week6.html","text":"tye","tags":"Misc"},{"title":"2016Fall Week7","url":"./2016fall-week7.html","text":"qwe","tags":"Misc"},{"title":"2016Fall Week8","url":"./2016fall-week8.html","text":"asd","tags":"Misc"},{"title":"2016Fall Week9","url":"./2016fall-week9.html","text":"rty","tags":"Misc"}]};